import * as React from 'react'

interface HeaderProps {
  sample: string;
}

const Header: React.FC<HeaderProps> = props => {
  const { sample } = props;
  return (
    <div>
      { sample }
      <Icon
          src='../public/icon.png'
          alt='test'
      />
    </div>
  );
};

export default Header;
